import React, { Component } from 'react';
import {withRouter} from 'react-router-dom';

class Header extends Component {

    render() {
        return (
            <div>
                <button>Home</button>
                <button>Product</button>
                <button>Contact</button>
                <button>Login</button>
            </div>
        )
    }
}
export default withRouter(Header);
